-- ----------------------------
-- Procedure structure for jxGetEntryNode
-- ----------------------------
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `jxGetEntryNode`(IN JobName varchar(45))
    READS SQL DATA
select r.identifier,
left(p4.value,255) name,
r.rec_type,
left(p0.value,255) stagetype,
left(p1.value,255) inputpins,
left(p2.value,255) outputpins,
left(p5.value,255) linktype,
left(p3.value,255) partner
from jx_record r
inner join jx_job j on (j.id_job = r.id_job and j.identifier = JobName)
left join jx_record_property p0 on (r.id_record = p0.id_record and p0.Name = 'StageType')
left join jx_record_property p1 on (r.id_record = p1.id_record and p1.Name = 'InputPins')
inner join jx_record_property p2 on (r.id_record = p2.id_record and p2.Name = 'OutputPins')
left join jx_record_property p3 on (r.id_record = p3.id_record and p3.Name = 'Partner')
left join jx_record_property p4 on (r.id_record = p4.id_record and p4.Name = 'Name')
left join jx_record_property p5 on (r.id_record = p5.id_record and p5.Name = 'LinkType')
where p1.value is null and r.identifier like 'V0%'
order by inputpins, outputpins desc;;
DELIMITER ;

