INSERT INTO `jx_record_property` VALUES ('2164', '1261', 'Description', 'IsNull(LookCFalfanumPF.cod_attrib_fiscale) Or \nIconv(StepCFalfaNoPiva.ora_sysdate [1,10],\"D-YMD\") - Iconv(LookCFalfanumPF.data_elab_sogei [1,10],\"D-YMD\") >= StepCFalfaNoPiva.NUM_GG_VALIDITA_SCPI Or Not(IsNull(LookCFalfanumPF.flg_inesistente))\n\n\nnote:   il CF non e\' mai passato per la miniSOGEI (CF non trovato), oppure\n           record e\' scaduto (data.elab.sogei troppo vecchia), oppure\n           record e\' inesistente per SOGEI (record trovato ha il flag inesistente impostato)\n\n\nGESTIONE cod.stato.elaborazione\n============================\n\nIf IsNull(LookCFalfanumPF.cod_attrib_fiscale) Or                              --  le prime due condizione del constraint\n   Iconv(StepCFalfaNoPiva1.ora_sysdate [1,10],\"D-YMD\") - Iconv(LookCFalfanumPF.data_elab_sogei [1,10],\"D-YMD\") >= StepCFalfaNoPiva1.NUM_GG_VALIDITA_SCPI \nThen 11         --    richiedere a Sogei\nElse 42           --    inviare a BIC come inesistente\n');
