INSERT INTO `jx_record_property` VALUES ('2209', '1265', 'Description', 'select id_prog_rec_sogei,cod_attrib_fiscale,denominazione,piva,TO_CHAR(data_elab_sogei, \'YYYY-MM-DD HH24:MI:SS\')\nfrom (\nselect s.id_prog_rec_sogei,s.cod_attrib_fiscale,s.denominazione,s.piva,s.data_elab_sogei\nfrom cert_pg_sto s\nwhere s.piva = :4 and s.flg_inesistente is not null\nunion\nselect g.id_prog_rec_sogei,g.cod_attrib_fiscale,g.denominazione,g.piva,g.data_elab_sogei\nfrom cert_pg g \nwhere g.piva = :4\nor g.piva = \n(select distinct s.piva_new from cert_pg_sto s\n where s.piva = :4)\n) order by flg_inesistente desc,data_elab_sogei desc\n\n\nnote:    ricerca totale della pIVA definitiva sulla CERT_PG e CERT_PG_STO - se record esiste nella PG, sara\' sempre il primo (anche con valore pIVA modificato)\n                                                                                                                 - se esiste/esitono solo record \"inesistenti\", il valore del flg_inesistente per il primo record sara\' not null');
