INSERT INTO `jx_record_property` VALUES ('2215', '1266', 'Description', 'tutti i casi, dove il cod.fiscale e\' stato trovato\n\n\n\nGESTIONE cod.stato.elaborazione :\n\nIf CodfisExists And PivaExists Then                                                                                             ---       esistono e non sono scaduti i record del cod.fis. e della p.IVA\nIf LookCFalfaPivaPF.cod_attrib_fiscale = LookCFalfaPivaPG.cod_attrib_fiscale Then               ---       PF.cod.fis. corrisponde al  PG.cod.fis.\nIf (StepCFalfaPiva1.nome = LookCFalfaPivaPF.nome And                                                          ---       dati anagrafici + regione sociale sono identici a quelli presenti in miniSogei ...\n    StepCFalfaPiva1.cognome = LookCFalfaPivaPF.cognome And\n    StepCFalfaPiva1.ragione_sociale = LookCFalfaPivaPG.denominazione And\n    StepCFalfaPiva1.cod_sesso = LookCFalfaPivaPF.nome And\n    StepCFalfaPiva1.dt_nascita = \n    (If IsNull(LookCFalfaPivaPF.data_nascita_aaaa) Then \"19\" : LookCFalfaPivaPF.data_nascita_aa \n    Else LookCFalfaPivaPF.data_nascita_aaaa) : \"-\" :\n    LookCFalfaPivaPF.data_nascita_mm : \"-\" : LookCFalfaPivaPF.data_nascita_gg And\n    StepCFalfaPiva1.comune_nascita = LookCFalfaPivaPF.nome And\n    StepCFalfaPiva1.prov_nasc = LookCFalfaPivaPF.nome ) \nThen 41                                                                                                                                      ---    ... allora record puo\' essere confermato identico a Sogei\nElse 21                                                                                                                                        ---    (se dati anagrafici non corrispondono)  inviamo a QS\nElse 60                                                                                                                                        ---    (se codici fiscali non corrispondono)    i record sono AMBUGUI\nElse 11                                                                                                                                        ---    (se uno dei codici non esiste o e\' scaduto)     inviamo a Sogei');
