INSERT INTO `jx_record_property` VALUES ('2241', '1268', 'Description', 'SELECT \nid_prog_rec_sogei, cod_attrib_fiscale, cognome, nome, sesso, data_nascita_aa, data_nascita_mm, data_nascita_gg,\ncomune_nasc_o_stato_est, prov_nascita, data_nascita_aaaa, TO_CHAR(data_elab_sogei, \'YYYY-MM-DD HH24:MI:SS\'), flg_inesistente \nFROM \n(\nselect \ns.id_prog_rec_sogei, s.cod_attrib_fiscale, s.cognome, s.nome, s.sesso, s.data_nascita_aa, s.data_nascita_mm, s.data_nascita_gg,\ns.comune_nasc_o_stato_est, s.prov_nascita, s.data_nascita_aaaa, s.data_elab_sogei, s.flg_inesistente \nfrom CERT_PF_STO s\nwhere s.cod_attrib_fiscale = :2 and s.flg_inesistente is not null\nunion\nselect \nf.id_prog_rec_sogei, f.cod_attrib_fiscale, f.cognome, f.nome, f.sesso, f.data_nascita_aa, f.data_nascita_mm, f.data_nascita_gg,\nf.comune_nasc_o_stato_est, f.prov_nascita, f.data_nascita_aaaa, f.data_elab_sogei, null flg_inesistente\nfrom CERT_PF f \nwhere f.cod_attrib_fiscale = :2\nor f.cod_attrib_fiscale = \n(select distinct s.cod_attrib_fiscale_new from cert_pf_sto s\n where s.cod_attrib_fiscale = :2)\n) order by flg_inesistente desc,data_elab_sogei desc\n\n\nnote:    ricerca totale del CF definitivo sulla CERT_PF e CERT_PF_STO - se record esiste nella PF, sara\' sempre il primo (anche con valore CF modificato)\n                                                                                                                 - se esiste/esitono solo record \"inesistenti\", il valore del flg_inesistente per il primo record sara\' not null');
