INSERT INTO `jx_record_property` VALUES ('2387', '1283', 'Description', 'GESTIONE cod.stato.elaborazione:\n============================\nIf Not(IsNull(LookCFalfanumPG.piva)) And \n   Iconv(StepCFalfaNoPiva2.ora_sysdate [1,10],\"D-YMD\") - Iconv(LookCFalfanumPG.data_elab_sogei [1,10],\"D-YMD\") >= \n   StepCFalfaNoPiva2.NUM_GG_VALIDITA_SCPI                               --    pIVA esiste ed il record e\' scaduto\nThen 11                                                                     --    inviare a Sogei\nElse If                                                                         --    con o senza pIVA, verifica i dati anagrafici\n(StepCFalfaNoPiva2.nome = StepCFalfaNoPiva2.pf_nome And                                                                                    --     nome\n StepCFalfaNoPiva2.cognome = StepCFalfaNoPiva2.pf_cognome And                                                                        --     cognome\n StepCFalfaNoPiva2.dt_nascita [1,10] = \n  (If IsNull(StepCFalfaNoPiva2.pf_data_nascita_aaaa) Then \"19\" : StepCFalfaNoPiva2.pf_data_nascita_aa \n  Else StepCFalfaNoPiva2.pf_data_nascita_aaaa) : \"-\" :\n  StepCFalfaNoPiva2.pf_data_nascita_mm : \"-\" : StepCFalfaNoPiva2.pf_data_nascita_gg And                                   --     data di nascita\n StepCFalfaNoPiva2.cod_sesso = StepCFalfaNoPiva2.pf_sesso And                                                                           --     sesso\n StepCFalfaNoPiva2.comune_nascita = StepCFalfaNoPiva2.pf_comune_nascita And                                                 --     comune di nascita\n StepCFalfaNoPiva2.prov_nasc = StepCFalfaNoPiva2.pf_prov_nascita                                                                        --     provincia di nascita\n)\nThen 41               --    inviare a BIC, dati identici a Sogei\nElse 21                 --    inviare a QS\n');
