INSERT INTO `jx_record_property` VALUES ('2469', '1292', 'Description', '\nGESTIONE cod.stato.elaborazione\n============================\n\nIf CodFisExists Then                                                                                                           ---   CF trovato e non e\' scaduto\nIf (StepCFpIVAnum2.nome = LookCFpIVAnumPF.nome And                                             ---     controllare i dati anagrafici\n    StepCFpIVAnum2.cognome = LookCFpIVAnumPF.cognome And\n    StepCFpIVAnum2.ragione_sociale = StepCFpIVAnum2.PG_denominazione And\n    StepCFpIVAnum2.cod_sesso = LookCFpIVAnumPF.nome And\n    StepCFpIVAnum2.dt_nascita = \n     (If IsNull(LookCFpIVAnumPF.data_nascita_aaaa) Then \"19\" : LookCFpIVAnumPF.data_nascita_aa \n      Else LookCFpIVAnumPF.data_nascita_aaaa) : \"-\" :\n              LookCFpIVAnumPF.data_nascita_mm : \"-\" : \n              LookCFpIVAnumPF.data_nascita_gg And\n    StepCFpIVAnum2.comune_nascita = LookCFpIVAnumPF.nome And\n    StepCFpIVAnum2.prov_nasc = LookCFpIVAnumPF.nome ) \nThen 41                                                                                                         --      dati anagrafici identici a quelli della Sogei,  inviare a BIC\nElse 21                                                                                                           --      dati anagrafici da controllare con QS\nElse 11                                                                                                           --      record non trovato o scaduto,  da inviare a Sogei\n');
