INSERT INTO `jx_subrecord_property` VALUES ('13821', '5319', 'Value', 'select id_prog_rec_sogei,cod_attrib_fiscale,denominazione,piva,TO_CHAR(data_elab_sogei, \'YYYY-MM-DD HH24:MI:SS\'),flg_inesistente from \n(select  --+ rule\n s.id_prog_rec_sogei,s.cod_attrib_fiscale,s.denominazione,s.piva,s.data_elab_sogei,s.flg_inesistente \n from cert_pg_sto s\n where (s.piva = decode(length(:2),16,substr(:2,6,11),:2) or s.piva = :4 or\n        s.cod_attrib_fiscale = :2 or s.cod_attrib_fiscale = :4) \n and s.flg_inesistente is not null\nunion\n select  --+ rule\n g.id_prog_rec_sogei,g.cod_attrib_fiscale,g.denominazione,g.piva,g.data_elab_sogei,null \n from cert_pg g \n where (g.piva = decode(length(:2),16,substr(:2,6,11),:2) or g.piva = :4 or \n        g.cod_attrib_fiscale = :2 or g.cod_attrib_fiscale = :4)\n or g.piva = \n (select  --+ rule\n  distinct s.piva_new from cert_pg_sto s\n  where (s.piva = decode(length(:2),16,substr(:2,6,11),:2) or s.piva = :4)\n  and s.piva_new is not null)\n or g.cod_attrib_fiscale = \n (select  --+ rule\n  distinct s.cod_attrib_fiscale_new from cert_pg_sto s\n  where (s.cod_attrib_fiscale = :2 or s.cod_attrib_fiscale = :4)\n  and s.cod_attrib_fiscale_new is not null)\n) order by flg_inesistente desc,data_elab_sogei desc');
