INSERT INTO `jx_subrecord_property` VALUES ('15159', '5390', 'Value', 'select id_prog_rec_sogei,cod_attrib_fiscale,denominazione,piva,TO_CHAR(data_elab_sogei, \'YYYY-MM-DD HH24:MI:SS\'),flg_inesistente\nfrom (\nselect --+ rule\ns.id_prog_rec_sogei,s.cod_attrib_fiscale,s.denominazione,s.piva,s.data_elab_sogei,s.flg_inesistente\nfrom cert_pg_sto s\nwhere (s.piva = :4 or s.cod_attrib_fiscale = :4) and s.flg_inesistente is not null\nunion\nselect --+ rule\ng.id_prog_rec_sogei,g.cod_attrib_fiscale,g.denominazione,g.piva,g.data_elab_sogei,null\nfrom cert_pg g \nwhere g.piva = :4 or g.cod_attrib_fiscale = :4\nor g.piva = \n(select --+ rule\n distinct s.piva_new from cert_pg_sto s\n where s.piva = :4 and s.piva_new is not null)\nor g.cod_attrib_fiscale = \n(select --+ rule\n distinct s.cod_attrib_fiscale_new from cert_pg_sto s\n where s.cod_attrib_fiscale = :4\n and s.cod_attrib_fiscale_new is not null)\n) order by flg_inesistente desc,data_elab_sogei desc');
